import './css/ExpenseItem.css';

import Card from './Card';

function Status() {
    const isSigned = 'Signed | Negative';

    return (
        <Card >
            <div className="expense-item__description"> 
                 <div >
                        <h2 className="expense-item__price">{isSigned}</h2>
                  </div> 
              </div> 
        </Card>
    );
}

export default Status;
